import {  Routes, Route } from 'react-router-dom';
import {Fragment} from 'react';
import FavoritesPage from './pages/Favorites';
import NewMeetupPage from './pages/NewMeetup';

function App() {
  return (
  <div>

    <Fragment>
        <Routes>
          <Route path='/new-meetup'>
            <NewMeetupPage />
          </Route>
          <Route path='/favorites'>
          <FavoritesPage />
          </Route>
        </Routes>
     </Fragment>
  </div>
  );
}

export default App;
